import Header from '../components/Header';
import Footer from '../components/Footer';

function Checkout() {
  return (
    <div className='checkout'>
      <Header />
      <div className='container'>
        Checkout Form
      </div>
      <Footer />
    </div>
  );
}

export default Checkout;
